import './item.css';
import React from 'react'

function Item(){
    return(
        <section className="item">
            <div className="item-container">
                <div className="picture">{/* imagen */}</div>
                <div className="info-container">
                    <h4>Category</h4>
                    <h2>Nombre</h2>
                    <div>
                        <button>Canjear</button>
                        <img src="" alt="Buy"/>
                    </div>
                </div>
            </div>
        </section>
    );
}

export default Item;
